import React from 'react';
import Title from '../../components/Title/Title';

const HomePage = () => {
    return (
        <div>
            <Title
                titleText={"Gabriel"}
                additionalClass='cor-titulo'
            />
            <Title
                titleText={"Henrique"}
                additionalClass='cor-titulo'
            />
        </div>
    );
};

export default HomePage;
